import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const NavbarLinks = () => {
	return (
		<div id='myMobileLinks'>
			<NavList>
				<li>
					<StyledLink to='/' onClick={this.props.handleClick}>
						Home
					</StyledLink>
				</li>
				<li>
					<Link to='../About' onClick={this.props.handleClick}>
						About
					</Link>
				</li>
				<li>
					<Link to='../Menu' onClick={this.props.handleClick}>
						Menu
					</Link>
				</li>
				<li>
					<Link to='../Contact' onClick={this.props.handleClick}>
						Contact
					</Link>
				</li>
			</NavList>
		</div>
	);
};

export default NavbarLinks;

const StyledLink = styled(Link)`
	color: red;
`;

const NavList = styled.ul`
	background-color: #304050;
	font-family: 'Roboto';
	z-index: 100;
	display: flex;
	justify-content: center;
	align-items: center;
	list-style-type: none;
	color: white;
	width: 100%;

	li {
		transition: 0.2s;
		font-size: 0.9rem;
		cursor: pointer;

		&:hover {
			background-color: #203040;
		}

		a {
			text-decoration: none;
			color: white;
			font-size: 1.2rem;
		}
	}
`;

